print("void matrix_multiply(const Matrix& A, Matrix& result) {\n    size_t n = A.size();\n    size_t m = A[0].size();\n    size_t p = result[0].size();\n\n    for (size_t i = 0; i < n; ++i) {\n        for (size_t j = 0; j < p; ++j) {\n            int sum = 0;\n            for (size_t k = 0; k < m; ++k) {\n                sum += A[i][k] * result[k][j];\n            }\n            result[i][j] = sum;\n        }\n    }\n}")